#pragma mark Generated Images

+ (UIImage*)imageOfNodePCBA
{
    if (_imageOfNodePCBA)
        return _imageOfNodePCBA;

    UIGraphicsBeginImageContextWithOptions(CGSizeMake(315, 390), NO, 0.0f);
    [PionOneStyleKit drawNodePCBA];

    _imageOfNodePCBA = UIGraphicsGetImageFromCurrentImageContext();
    UIGraphicsEndImageContext();

    return _imageOfNodePCBA;
}

#pragma mark Customization Infrastructure

- (void)setNodePCBATargets: (NSArray*)nodePCBATargets
{
    _nodePCBATargets = nodePCBATargets;

    for (id target in self.nodePCBATargets)
        [target setImage: PionOneStyleKit.imageOfNodePCBA];
}


